select *
from core.customerorder co
left join core.student s on s.studentid = co.studentid
left join core.Classroom c on c.classroomid = s.ClassroomID
where co.FormCode = '000A'
and c.ClassroomID IS NOT NULL
and co.customerorderstateid IN (38, 39)
and co.CustomerOrderID >= 87779261
order by co.CustomerOrderID desc

set transaction isolation level snapshot;
select co.CustomerOrderID, s.*
from core.customerorder co
left join core.student s on s.studentid = co.studentid
--left join core.Classroom c on c.classroomid = s.ClassroomID
where co.FormCode = '000A'
--and c.ClassroomID IS NOT NULL
and s.LeaderID > 0
and s.OnlineID is null
and co.customerorderstateid IN (38, 39)
--and co.CustomerOrderID >= 87779261
order by co.CustomerOrderID desc

